// Custom JavaScript partials
// Inject bottom padding to main content equal to footer height
function adjustPadding() { $('.main-content').css('padding-bottom', $('.footer-container').height()); };

// Initial injection
adjustPadding();

// Inject on window resize
$(window).resize(function() { adjustPadding(); });

// Sticky header that appears after scrolling past hero
$(window).scroll(function() {
    if($(window).scrollTop() > $(window).height() - 100) {
      $('.header-container').addClass('fixed');
    } 
    else {
      $('.header-container').removeClass('fixed');
    }
});

// Expand header navigation mobile variant
$('.header-controls__nav-toggle').click(function() {
  $('.nav-menu').toggleClass('show-nav');

  var headerNav = $('.header-controls ul');

  if(headerNav.hasClass('show-nav')) {
    headerNav.removeClass('show-nav');
  }
  else {
    headerNav.addClass('show-nav');
  }
});

// Scroll to section from main navigation
$('.header-controls a').click(function(event) {
    var scrollOffset = 77;
    var scrollTargetId = $(this).attr("href");
    var scrollTarget = $(scrollTargetId).offset().top - scrollOffset;

    $('html, body').animate({
        scrollTop: scrollTarget
    }, 500);

    event.preventDefault();

	// Ensure mobile nav collapses on navigation scroll
	if($('.header-controls__nav-toggle input[type="checkbox"]').is(':checked')) {
		$('.header-controls__nav-toggle input[type="checkbox"]').prop('checked', false);
    $('.header-controls ul').removeClass('show-nav');
	}
});

